
function ProviderApprovalForm() {
    const pdf = {
        name: "adeia.pdf",
        base64: "data:application/pdf;base64,"
    }

    const handleClick = () => {
        // Αφαιρούμε το πρόθεμα 'data:application/pdf;base64,' από το base64 string
        const cleanBase64 = pdf.base64.replace(/^data:application\/pdf;base64,/, "");

        // Αποκωδικοποιούμε το base64 string και δημιουργούμε ένα Blob αντικείμενο
        const byteCharacters = atob(cleanBase64);
        const byteArrays = [];

        for (let offset = 0; offset < byteCharacters.length; offset += 1024) {
            const slice = byteCharacters.slice(offset, offset + 1024);
            const byteNumbers = new Array(slice.length);
            for (let i = 0; i < slice.length; i++) {
                byteNumbers[i] = slice.charCodeAt(i);
            }
            byteArrays.push(new Uint8Array(byteNumbers));
        }

        const blob = new Blob(byteArrays, { type: 'application/pdf' });
        const blobURL = URL.createObjectURL(blob);

        // Ανοίγουμε το PDF σε νέο παράθυρο χρησιμοποιώντας το blob URL
        const newWindow = window.open(blobURL, "_blank");
        if (newWindow) {
            newWindow.location.reload();
        }
    };

    return (
        <div className="amenity-form-container">
            <h1>Αίτημα Παρόχου</h1>
            <form className="amenity-form">
                <label htmlFor="name">Ονοματεπώνυμο:</label>
                <input
                    type="text"
                    id="name"
                    // value={formData.name}
                    // onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                    required
                    readOnly
                />

                <label htmlFor="email">Email:</label>
                <input
                    type="text"
                    id="email"
                    // value={formData.email}
                    // onChange={(e) => setFormData({ ...formData, email: e.target.value })}
                    required
                    readOnly
                />

                <label htmlFor="phone1">Τηλέφωνο:</label>
                <input
                    type="text"
                    id="phone1"
                    // value={formData.phone1}
                    // onChange={(e) => setFormData({ ...formData, phone1: e.target.value })}
                    required
                    readOnly
                />

                <label htmlFor="phone2">Κινητό:</label>
                <input
                    type="text"
                    id="phone2"
                    // value={formData.phone2}
                    // onChange={(e) => setFormData({ ...formData, phone2: e.target.value })}
                    required
                    readOnly
                />

                <label htmlFor="address">Διεύθυνση:</label>
                <input
                    type="text"
                    id="address"
                    // value={formData.address}
                    // onChange={(e) => setFormData({ ...formData, address: e.target.value })}
                    required
                    readOnly
                />

                <label htmlFor="pdf">Αρχείο PDF:</label>
                <a
                    href="#"
                    onClick={handleClick}
                    style={{ color: 'blue', textDecoration: 'underline', cursor: 'pointer' }}
                >
                    {pdf.name}
                </a>
            </form>
        </div>
    );
}

export default ProviderApprovalForm;
